import { EthProvider } from "./contexts/EthContext";
import RequestDelivery from "./components/RequestDelivery";
import AcceptDelivery from "./components/AcceptDelivery";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import "./App.css";

function App() {
  <Router>
    <Routes>
      <Route exact path="/" element={<RequestDelivery />}></Route>
      <Route exact path="/AcceptDelivery" element={<AcceptDelivery />}></Route>
    </Routes>
  </Router>
  return (
    <EthProvider>
      <div id="App" >
        <div className="container">
        </div>
      </div>
    </EthProvider>
  );
}



export default App;
